・
・
モロッコは1人旅と友人との2回行きましたが、今回は友人と2018年の年末に行ったフェズ🇲🇦青い街で知られるシェフシャウエンへ行く経由地として行く人も多いですが、私達もその1人。笑　しかし、フェズももちろん訪れる価値のある街です！！シェフシャウエンを挟んで前後で2カ所の宿泊先を予約しましたが、2つ目が本当に見つけにくくて…有名なブージュルード(通称:ブルーゲート、3枚目)からはTAXIが入れないので7〜8分歩くのですが、メインストリートはくねくねと1本で続いていても、どこで左に曲がれば地図上じゃよくわからなかったのです🤣人に聞いたり、行ったり戻ったりしながら、行き止まりの先にあるホテルの名前が書いてある扉を見つけ、扉を叩いてようやく中に入れてもらえました😳
・
・
フェズは街を歩いていると急にロバが出てきたり、誰かに呼び止められたり、忙しないようで、でもマラケシュよりはゆったりしていました。人混みの中を進んでいくと、いきなり豪華なアラベスクの装飾が施された建物に辿り着いたり、可愛らしいお店があったひ、何だか大きな宝箱の中を探検しているみたいでした😆フェズは皮なめしで有名ですが、それ以外にも繊細な技術が求められる職人が多いと感じました。石に細かい模様を彫っていたり、4枚目の写真のような木を使ったartisticなコースター作る人だったり、カラフルな模様を陶器に描く人だったり…荷物を少なくしていたので我慢しましたが、もっと沢山買えば良かった🥺💕まあ、次回のお楽しみということで❣️
・
